import React, { useState, useEffect } from "react";
import { usePlaidLink } from "react-plaid-link";
import axios from "axios";
import {
  Button,
  CircularProgress,
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Accordion,
  AccordionSummary,
  AccordionDetails,
} from "@mui/material";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";

const PlaidIntegration = () => {
  const [linkToken, setLinkToken] = useState(null);
  const [accessToken, setAccessToken] = useState(null);
  const [accounts, setAccounts] = useState([]);
  const [transactions, setTransactions] = useState([]);
  const [income, setIncome] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch link token from backend
  useEffect(() => {
    const fetchLinkToken = async () => {
      try {
        const response = await axios.post("http://localhost:5000/api/create_link_token");
        setLinkToken(response.data.link_token);
      } catch (error) {
        console.error("Error creating link token:", error);
      }
    };
    fetchLinkToken();
  }, []);

  // Initialize Plaid Link
  const { open, ready } = usePlaidLink({
    token: linkToken,
    onSuccess: async (publicToken) => {
      try {
        setLoading(true);
        const response = await axios.post("http://localhost:5000/api/exchange_public_token", { public_token: publicToken });
        setAccessToken(response.data.access_token);
        fetchBankData(response.data.access_token);
      } catch (error) {
        console.error("Error exchanging token:", error);
      } finally {
        setLoading(false);
      }
    },
  });

  // Fetch accounts, transactions, and income data
  const fetchBankData = async (token) => {
    try {
      setLoading(true);

      // Fetch Accounts
      const accountResponse = await axios.post("http://localhost:5000/api/accounts", { access_token: token });
      setAccounts(accountResponse.data.accounts || []);

      // Fetch Transactions
      const transactionResponse = await axios.post("http://localhost:5000/api/transactions", { access_token: token });
      setTransactions(transactionResponse.data.transactions || []);

      // Fetch Income
      const incomeResponse = await axios.post("http://localhost:5000/api/income", { access_token: token });

      if (incomeResponse.data && Array.isArray(incomeResponse.data.income)) {
        setIncome(incomeResponse.data.income);
      } else {
        setIncome([]); // Prevents undefined issues
      }

    } catch (error) {
      console.error("❌ Error fetching financial data:", error);
    } finally {
      setLoading(false);
    }
  };

  // Group data by month
  const groupDataByMonth = (data, dateField) => {
    const grouped = {};

    data.forEach((item) => {
      if (!item[dateField]) return; // Skip if date is invalid

      const date = new Date(item[dateField]);
      if (isNaN(date)) return; // Ensure valid date parsing

      const monthYear = date.toLocaleString("default", { month: "short", year: "numeric" });

      if (!grouped[monthYear]) {
        grouped[monthYear] = { items: [], total: 0 };
      }

      grouped[monthYear].items.push(item);
      grouped[monthYear].total += item.amount;
    });

    return grouped;
  };

  const groupedTransactions = groupDataByMonth(transactions, "date");
  const groupedIncome = groupDataByMonth(income, "date");

  return (
    <Container maxWidth="md" style={{ textAlign: "center", marginTop: "20px" }}>
      <Typography variant="h4" gutterBottom>
        Finance Advisor
      </Typography>

      <Button
        variant="contained"
        color="primary"
        onClick={open}
        disabled={!ready || !linkToken}
        style={{ marginBottom: "20px" }}
      >
        Connect Bank Account
      </Button>

      {loading && <CircularProgress />}

      {/* Display Income */}
      {Object.entries(groupedIncome).map(([month, data]) => (
        <Accordion key={month} style={{ marginTop: "10px", backgroundColor: "#2e7e32", color: "white" }}>
          <AccordionSummary expandIcon={<ExpandMoreIcon style={{ color: "white" }} />}>
            <Typography variant="h6" style={{ fontWeight: "bold", width: "100%" }}>
              {month} (Income) <span style={{ float: "right" }}>${(data.total || 0).toFixed(2)}</span>
            </Typography>
          </AccordionSummary>
          <AccordionDetails>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Source</TableCell>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Amount</TableCell>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Date</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.items.map((incomeItem, index) => (
                    <TableRow key={index}>
                      <TableCell style={{ color: "white" }}>
                        {incomeItem.source || "Unknown Source"}
                      </TableCell>
                      <TableCell style={{ color: "white" }}>
                        ${(incomeItem.amount || 0).toFixed(2)}
                      </TableCell>
                      <TableCell style={{ color: "white" }}>
                        {incomeItem.date ? new Date(incomeItem.date).toDateString() : "Invalid Date"}
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </AccordionDetails>
        </Accordion>
      ))}

      {/* Display Transactions */}
      {Object.entries(groupedTransactions).map(([month, data]) => (
        <Accordion key={month} style={{ marginTop: "10px", backgroundColor: "#2e2e2e", color: "white" }}>
          <AccordionSummary expandIcon={<ExpandMoreIcon style={{ color: "white" }} />}>
            <Typography variant="h6" style={{ fontWeight: "bold", width: "100%" }}>
              {month} (Expenses) <span style={{ float: "right" }}>${(data.total || 0).toFixed(2)}</span>
            </Typography>
          </AccordionSummary>
          <AccordionDetails>
            <TableContainer>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Bank</TableCell>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Name</TableCell>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Price</TableCell>
                    <TableCell style={{ color: "white", fontWeight: "bold" }}>Date</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.items.map((transaction) => (
                    <TableRow key={transaction.transaction_id}>
                      <TableCell style={{ color: "white" }}>{transaction.bank_name || "N/A"}</TableCell>
                      <TableCell style={{ color: "white" }}>{transaction.name}</TableCell>
                      <TableCell style={{ color: "white" }}>${transaction.amount.toFixed(2)}</TableCell>
                      <TableCell style={{ color: "white" }}>{new Date(transaction.date).toDateString()}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </AccordionDetails>
        </Accordion>
      ))}
    </Container>
  );
};

export default PlaidIntegration;
